svg.script:
var DigitalArtFramer = new function()
{
  var displayCredits = true;
  var displayFrame = true;
  var query="";
  var uploader="";
  var sortby="date";
  var amount=20;           //max = 20
  var timeout=120000;      //default to 2 minutes = 120,000 ms
  var ids="";
  var imgids;
  var url;
  var bg="none";
  var delay = true;

  var qs = location.search;
  if(qs.length!=0)
  {
    qs = qs.replace("?","");
    var params = qs.split("&");
    for(var i=0;i<params.length;i++)
    {
      var values = params[i].split("=");
      if(values[0]=="q") query = values[1];
      if(values[0]=="u") uploader = values[1];
      if(values[0]=="ids") ids = values[1];

      if(values[0]=="s") sortby = values[1];
      if(values[0]=="t") timeout = values[1]*1000;
      if(values[0]=="a") amount = Number(values[1]);
      if(amount<1 || amount>20) amount=20;

      if(values[0]=="bg") bg = values[1];
      bg = bg.replace("%23","#");

      if(values[0]=="c") displayCredits = Number(values[1]);
      if(values[0]=="f") {displayFrame = Number(values[1]); if(!displayFrame) displayCredits = false;}
      if(values[0]=="d") delay = Number(values[1]);

    }
  }

  if(query.length==0 && uploader.length==0 && ids.length==0)
  {
    //default query - comment out variable ids to get the other default query
    ids = "234082,173665,176191,173839,204711,173682,20655,189650,189339,188775,234083,189188,101785,9280,173821,100807,173818,206340,96331,227698";

    query="pixabay+landscape+water";   //Open Clip Art Query String
    uploader="GDJ";              //Open Clip Art Contributor's Name
    sortby="downloads";          //allowed values: date, downloads, favorites
  }

  if(ids.length>0)
  {
    url = "https://openclipart.org/search/json/?byids="+ids+"&amount="+amount;
    imgids = ids.split(",");
  }
  else
    url = "https://openclipart.org/search/json/?query="+(query+" "+uploader).trim()+"&amount="+amount+"&sort="+sortby;

  var xmlHTTP = new XMLHttpRequest();

  var json;
  var index=0;
  var timerID;
  var title;
  var artist;

  if(delay)
    window.addEventListener("load", function(e) {setTimeout(init,1000);});  // Required for openclipart to capture default image
  else
    window.addEventListener("load", init);


  function init()
  {
    var node;

    if(!delay)
    {
      node = document.getElementById("DAFtitleframe");
      if(node!=null) node.setAttribute("style","display:none;");

      if(!displayFrame)
      {
        node = document.getElementById("DAFrame");
        node.setAttribute("style","display:none");
      }
    }

    node = document.getElementById("DAFprev");
    node.addEventListener("click", function(e) {advance(-2)});
    node = document.getElementById("DAFnext");
    node.addEventListener("click", function(e) {advance(0)});
    node = document.getElementById("DAFpause");
    node.addEventListener("click", function(e) {clearTimeout(timerID);});
    node = document.getElementById("DAFimg");
    node.addEventListener("load", imageLoaded);

    document.addEventListener("keydown", function(e) {getKey(e);});

    sendRequest();
  }

  function getKey(e)
  {
    var key = (e.charCode!=0)? e.charCode : e.keyCode;
    switch(key)
    {
      case 37: {advance(-2); break;}
      case 39: {advance(0); break;}
      case 40: {clearTimeout(timerID); break;}
    }
  }

  function advance(increment)
  {
    clearTimeout(timerID);
    index+=increment;
    if(index<0) index=amount-1;
    displayImage()
  }

  function imageLoaded()
  {
    clearTimeout(timerID);

    if(displayCredits)
    {
      document.getElementById("DAFtitle").firstChild.nodeValue = title;
      document.getElementById("DAFartist").firstChild.nodeValue = artist;
    }

    timerID = setTimeout(displayImage,timeout);
  }

  function displayImage()
  {
    if(!(index<amount)) index=0;
    if(!(index<json.info.results)) index=0;

    var idx = index;

    if(ids.length>0 && imgids.length==amount)
    {
      for(var i=0;i<amount;i++)
      {
        var id = json.payload[i].id;
        if(id==imgids[index])
        {
          idx = i;
          break;
        }
      }
    }

    var node = document.getElementById("DAFimg");
    if(ids.length>0 || uploader.length==0 || json.payload[idx].uploader==uploader)
    {
      var imageURL = json.payload[idx].svg.url;
      title = json.payload[idx].title;
      artist = json.payload[idx].uploader;

      node.setAttribute("xlink:href",imageURL);

      var detail = json.payload[idx].detail_link;
      node = document.getElementById("DAFlink");
      node.setAttribute("xlink:href",detail);

      document.getElementById("DAFtitle").firstChild.nodeValue = " ";
      document.getElementById("DAFartist").firstChild.nodeValue = " ";        
    }
    else
    {
      index++;
      timerID = setTimeout(displayImage,100);
      return;
    }

    index++;
    timerID = setTimeout(imageLoaded,1000);
  }

  /**************************************************
  * Send Request
  **************************************************/
  function sendRequest()
  {
     xmlHTTP.onload = processResponse;
     xmlHTTP.open("GET",url,true);
     xmlHTTP.send();
  }

  /**************************************************
  * Process Response
  **************************************************/
  function processResponse()
  {
    try
    {
      if(this.status == 200)
      {
      	json = JSON.parse(this.responseText);
      	var results = json.info.results;
      	if(results < amount) amount = results;

        var node = document.getElementById("DAFtitleframe");
        if(node!=null) node.setAttribute("style","display:none;");

        node = document.getElementById("DAFbg");
        node.setAttribute("style","fill:"+bg);

        if(!displayFrame)
        {
          node = document.getElementById("DAFrame");
          node.setAttribute("style","display:none");
        }

        displayImage();
      }
    }
    catch(e) {}
  }
}();
